import React from "react";
import { Link } from "react-router-dom";
import styles from "../styles/styledConsts";

const HomePage = () => {
  return (
    <div style={styles.container}>
      <h1>Bem-vindo ao Sistema de Gestão do Espatula Bar</h1>
      <p>Selecione uma opção no menu acima para continuar.</p>

      <div style={styles.cards}>
        <Link to="/clientes" style={styles.card}>
          <h2>Cliente</h2>
          <p>Ver informações para clientes.</p>
        </Link>

        <Link to="/funcionarios" style={styles.card}>
          <h2>Funcionário</h2>
          <p>Acesse o painel de controle para gerenciar o sistema.</p>
        </Link>

        <Link to="/sobre" style={styles.card}>
          <h2>Sobre</h2>
          <p>Informações sobre nós.</p>
        </Link>
      </div>

    </div>
  );
};

export default HomePage;
